// export default ModuleList;
import React from "react";
import { useParams } from "react-router-dom";
import db from "../../Database";
import { FaEllipsisV } from "react-icons/fa";
import { GoTriangleRight, GoTriangleDown } from "react-icons/go";
import { AiFillCheckCircle } from "react-icons/ai";
import { BsPlus } from "react-icons/bs";

const ControlButton = ({ children, className }) => (
  <button className={`btn ${className}`}>
    {children}
  </button>
);

function ModuleItem({ text }) {
  return (
    <li className="list-item">
      <div className="item-content">
        <FaEllipsisV className="icon-spacing" />
        <GoTriangleRight />
        <span>{text}</span>
      </div>
      <div className="icon-container">
        <AiFillCheckCircle className="text-success icon-spacing" />
        <GoTriangleDown className="icon-spacing" />
        <BsPlus className="icon-spacing" />
        <FaEllipsisV />
      </div>
    </li>
  );
}

function ModuleList() {
  const { courseId } = useParams();
  const modules = db.modules;

  const listItemsData = [
    { text: "Resources" },
    { text: "Required Textbook" },
    { text: "Week0 - INTRO" },
    { text: "Week1 - HTML" },
  ];

  return (
    <div>
      <div className="module-controls">
        <ControlButton className="btn-primary">Collapse All</ControlButton>
        <ControlButton className="btn-secondary">View Progress</ControlButton>
        <ControlButton className="btn-success">
          <AiFillCheckCircle /> Publish All
        </ControlButton>
        <ControlButton className="btn-danger">
          + Module <BsPlus />
        </ControlButton>
        <ControlButton className="btn-icon">
          <FaEllipsisV />
        </ControlButton>
        <hr />
      </div>
      <div>
        <ul className="list-group">
          {listItemsData.map((item, index) => (
            <ModuleItem key={index} {...item} />
          ))}
        </ul>
      </div>
    </div>
  );
}

export default ModuleList;
